import React, { Component } from 'react'

class Welcome extends Component {
  constructor (props) {
    super(props)
    this.state = {
      name: 'Nandini'
    }
  }

  handleState () {
    this.setState({ name: 'Nandini Venkat' })
  }

  render () {
    return (
      <>
        <h1>Hello {this.state.name}</h1>
        <button onClick={() => this.handleState()}>Change</button>
      </>
    )
  }
}

export default Welcome
